import "./GraphBar.css"

function GraphBar() {

    const months = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun',
        'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'
    ]

    return(
        <div className="graphbar-and-month">
            <div className="progress-bar"/>
            <div></div>
        </div>
    );
}

export default GraphBar;
